package com.baizhi.entity;/** * Created by dell on 2018/6/3. */public class UserNum {    private String province;    private Integer num;    @Override    public String toString() {        return "UserNum{" +                "province='" + province + '\'' +                ", num=" + num +                '}';    }    public String getProvince() {        return province;    }    public void setProvince(String province) {        this.province = province;    }    public Integer getNum() {        return num;    }    public void setNum(Integer num) {        this.num = num;    }    public UserNum() {    }    public UserNum(String province, Integer num) {        this.province = province;        this.num = num;    }}